import React from 'react';
import '../hoja-de-estilos/Inicio.css';

const Inicio = () => {
  return (
    <header>
        <div className="contenedor-inicio">
          <div className="contenedor-principal">
              <div className="contenedor-texto">
                  <nav className="navegacion">
                      <a className="enlaces-texto" href="Productos">Productos</a>
                      <a className="enlaces-texto" href="capturar-datos">Capturar datos</a>
                      <a className="enlaces-texto" href="https://www.google.com/" target="_blank" rel="noopener">Buscador</a>
                  </nav>
              </div>
          </div>
          <img className="logo" src={require(`../imagenes/icons/tienda.png`)}/>
        </div>
    </header>
  );
};

export default Inicio;
